CREATE TABLE Localite(
  IdLocalite INTEGER NOT NULL AUTO_INCREMENT
  ,CP        INTEGER  NOT NULL 
  ,Commune   VARCHAR(30) NOT NULL
  ,Longitude NUMERIC(15,13) NOT NULL
  ,Latitude  NUMERIC(15,12) NOT NULL
  ,PRIMARY KEY(IdLocalite)
);





























